import {useDispatch} from "react-redux";
import {useState} from "react";
import {saveResumeBuilder} from "../ProfileBuilder/ResumeBuilder/action";
import Modal from "./modal";
import Certifications from "../ProfileBuilder/ResumeBuilder/certifications";

export default (props) => {
    const dispatch = useDispatch();
    const [showModal, setShowModal] = useState(false);
    const editCertification = (event) => {
        event.preventDefault();
        setShowModal(!showModal);
    };
    const saveCertification = (event) => {
        event.preventDefault();
        setShowModal(!showModal);
        dispatch(saveResumeBuilder({url: "url", id:"id", gotoNextTab: false}));
    };
    return (
        <div className="col-md-12 col-xl-12">
            <div className="card">
                {
                    showModal && <Modal label={"Certifications"} showHide={editCertification} saveFunction={saveCertification}>
                        <Certifications/>
                    </Modal>
                }
                <div className="col-lg-12 col-md-12">
                    <div className="row">
                        <div className="card-header">
                            <div className="col-lg-4 col-md-4">
                                <h3>Certifications</h3>
                            </div>
                            <div className="col-lg-2 col-md-2">
                                <a id="EditCertification" href="#" onClick={editCertification}>
                                    <i className="fe fe-edit" title="Edit Certification Form"></i>
                                </a>
                            </div>
                        </div>
                    </div>
                </div>
                <div className="card-body">
                    <div className="form-group">
                    {
                        props.primary.map(prim => (
                            <div className="col-lg-12 col-md-12">
                                <label htmlFor="exampleInputname1">{prim}</label>
                            </div>
                        ))
                    }
                    </div>
                    <hr className="Line"/>
                    <br/>
                    <div className="row">
                        <div className="col-lg-4 col-md-4">
                            <h3>Other Certifications</h3>
                        </div>
                        <div className="col-lg-2 col-md-2">
                            <a id="EditCertification" href="#" onClick={editCertification}>
                                <i className="fe fe-edit" title="Edit Certification Form"></i>
                            </a>
                        </div>
                    </div>
                    <div className="form-group">
                        {
                            props.others.map(other=> (
                                <div className="col-lg-4 col-md-4">
                                    <label htmlFor="exampleInputname1">{other}</label>
                                </div>
                            ))
                        }
                    </div>
                </div>
            </div>
        </div>
    )
}
